import React from "react";

function Results({ result }) {
  if (!result) return null;

  return (
    <div className="mt-6 p-6 bg-gray-50 shadow-md rounded-2xl">
      <h2 className="text-xl font-bold mb-4">Analysis Results</h2>

      <div className="space-y-2">
        <p><strong>File Type:</strong> {result.file_type}</p>
        <p><strong>Word Count:</strong> {result.word_count}</p>
        <p><strong>Page Count:</strong> {result.page_count}</p>

        <div className="mt-4">
          <h3 className="font-semibold">Score Comparison:</h3>
          <ul className="list-disc list-inside">
            <li>PDF Score: {result.scores?.pdf || "N/A"}</li>
            <li>Word Score: {result.scores?.word || "N/A"}</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Results;
